script: |
  super -f text -I q6554.spq | sort > q6554.out

inputs:
  - name: q6554.spq
    data: |
      SELECT - 68 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NOT col0 NOT IN ( - col1 * col0 + - col1, 20 * - - col0 * - col0, col1 ) );
  - name: tab0

outputs:
  - name: q6554.out
    data: |
      -68
      -68
      -68
